/* IMPORT */
import { isUndefined } from './utils.js';
/* MAIN */
const extend = (target, source) => {
    for (const prop in source) {
        if (prop === 'overrides')
            continue;
        const value = source[prop];
        if (isUndefined(value))
            continue;
        target[prop] = value;
    }
    return target;
};
/* EXPORT */
export default extend;
